// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateOwnerLogic.sol";

/// @notice Stores contract/address pairs of deployed Syndicate
/// contracts.
contract SyndicateIntegrationsCoordinatorLogicV0 is SyndicateOwnerLogic {
    /// @notice The owner adds or updates a contract address.
    event ContractAddressUpdated(
        address indexed contractAddress,
        string contractName
    );

    /// @notice The owner removes a contract address.
    event ContractAddressRemoved(
        address indexed contractAddress,
        string contractName
    );

    /// @dev Currently we store the data inside the logic contract.
    /// Once we feel comfortable with what data is needed by outside
    /// parties we will split this into separate contracts.
    mapping(string => address) private contractAddress;

    constructor(address owner) SyndicateOwnerLogic(owner) {}

    /// @notice Getter for the addresses that the provided contracts are
    /// deployed at. Note that the function will return the addresses in the
    /// exact order provided in the input array. If any of requested contracts
    /// is not registered with the integrations coordinator, the function will
    /// revert.
    /// @param contractNames The contract names
    /// @return The address where the contract is deployed
    function getAddresses(string[] calldata contractNames)
        public
        view
        returns (address[] memory)
    {
        address[] memory addresses = new address[](contractNames.length);
        for (uint256 i = 0; i < contractNames.length; i++) {
            require(
                contractAddress[contractNames[i]] != address(0),
                "NO_SUCH_CONTRACT"
            );
            addresses[i] = contractAddress[contractNames[i]];
        }

        return addresses;
    }

    /// @notice Add or update contract/address pairs.
    /// @param contractNames The contract names
    /// @param addresses The addresses of the contracts
    function addOrUpdateContracts(
        string[] calldata contractNames,
        address[] calldata addresses
    ) public onlyOwner {
        // Both passed-in arrays must have the same length
        require(
            contractNames.length == addresses.length,
            "ARRAY_LENGTHS_DIFFER"
        );
        for (uint256 i = 0; i < contractNames.length; i++) {
            contractAddress[contractNames[i]] = addresses[i];
            emit ContractAddressUpdated(addresses[i], contractNames[i]);
        }
    }

    /// @notice Remove a contract
    /// @param contractName The contract name
    function removeContract(string calldata contractName) public onlyOwner {
        address oldAddress = contractAddress[contractName];
        require(oldAddress != address(0), "NO_SUCH_CONTRACT");
        contractAddress[contractName] = address(0);
        emit ContractAddressRemoved(oldAddress, contractName);
    }
}

